trailingComments.value:
if(this._error){
  if(this._model.onerror){
    this._model.onerror()
  }
}

if(this._loaded){
  this._model.loaded = true
  if(this._model.onload){
    this._model.onload()
  }
}

if(this._error || this._loaded){
  if(this._model.onloadend){
    this._model.onloadend()
  }
}

